import logo from '../../../../components/Logo/plane.png';
import './Hero.scss';
export const Hero = () =>{
    return(

        <div className="Hero">
            <div className="Hero-Airsection" style={{backgroundImage: logo}}>
                <div className="Hero-Text">
                    <p>Наша туристична агенція – ваш надійний гід у світі незабутніх подорожей. Ми спеціалізуємось на створенні унікальних туристичних програм, які поєднують комфорт</p>
                </div>
            </div>
        </div>
    );
}
